int __cdecl main(int argc, const char **argv, const char **envp)
{ signed int i; // [esp+1Ch] [ebp-1Ch] char s1[9]; // [esp+23h] [ebp-15h] unsigned int v6; // [esp+2Ch] [ebp-Ch] v6 = __readgsdword(0x14u); printf("Enter the password: "); __isoc99_scanf("%8s", s1); for ( i = 0; i <= 7; ++i ) s1[i] = complex_function(s1[i], i); if ( !strcmp(s1, "JACEJGCS") ) puts("Good Job."); else puts("Try again."); return 0;
} The main function is short and simple. It gets the user input from stdin. It only requires 8 bytes as password and for each of teh eight characters, a complex_function is applied to it. At the end of the day, those manupulations should cause the password to be transformed into JACEJGCS before printing a good job message which is the goal of this exercise. Let's check out the complex_function. int __cdecl complex_function(signed int a1, int a2)
{ if ( a1 <= 64 || a1 > 90 ) { puts("Try again."); exit(1); } return (3 * a2 + a1 - 65) % 26 + 65;
}} This complex function takes in two arguments. The first argument would be the s[i] which is the user's input at the i-th index and the second argument would be the i-index itself. It checks that they are ASCII printable characters before doing some sort of transformation to it, specifically (3 * a2 + a1 - 65) % 26 + 65, before returning that value.

